import React from "react";

function Highscore() {
    const savedScores = localStorage.getItem("score");
    const savedObj = JSON.parse(savedScores)

    console.log(savedObj);

    return (
      <div className="highscore-table">
         
          {
              savedObj.map(score=>{ 
              <tr>
                  <td>{score.name}</td>
                  <td>{score.score}</td>
                </tr>
              })
          }
          
      </div>
    );
  }
  
  export default Highscore;
